// Time complexity : O(max(m,n)).\\n// Space complexity : O(max(m,n)).\\nfunction sumLinkedLists(l1, l2) {\\n  function ListNode(data, next) {\\n    this.data = data;\\n    this.next = next;\\n  }\\n  let rootNode = new ListNode(0);\\n  let node = rootNode;\\n  let sum = 0;\\n  let carry = 0;\\n  while (l1 || l2 || sum > 0) {\\n    if (l1) {\\n      sum += l1.data;\\n      l1 = l1.next;\\n    }\\n    if (l2) {\\n      sum += l2.data;\\n      l2 = l2.next;\\n    }\\n    carry = Math.floor(sum / 10);\\n    sum = Math.floor(sum) % 10;\\n    node.next = new ListNode(sum);\\n    node = node.next;\\n    sum = carry;\\n    carry = 0;\\n  }\\n  return rootNode.next;\\n}"]},"submittedCode":{"javaScript":""},"testCases":{"Test_1":{"test_input":"function test_input() { class Node { constructor(data) { this.data = data; this.next = null; } } const a = new Node(3); const b = new Node(6); const c = new Node(5); a.next = b; b.next = c; const d = new Node(2); const e = new Node(4); const f = new Node(8); d.next = e; e.next = f; const val = window.sumLinkedLists(a, d); let arr = []; let cur = val; while (cur) { arr.push(cur.data); cur = cur.next; } return [\' L1 = 5->6->3 L2 = 8->4->2 \', arr] }","test_expected":[5,0,4,1],"code_output":null,"passed_test":false,"functionTest":true},"Test_2":{"test_input":"function test_input() { class Node { constructor(data) { this.data = data; this.next = null; } } const a = new Node(2); const b = new Node(4); const c = new Node(3); a.next = b; b.next = c; const d = new Node(5); const e = new Node(6); const f = new Node(4); d.next = e; e.next = f; const val = window.sumLinkedLists(a, d); let arr = []; let cur = val; while (cur) { arr.push(cur.data); cur = cur.next; } return [\'\', arr] }","test_expected":[7,0,8],"code_output":null,"passed_test":false,"functionTest":true},"Test_3":{"test_input":"function test_input() { class Node { constructor(data) { this.data = data; this.next = null; } } const a1 = new Node(1); const a2 = new Node(2); const a3 = 